import React, { Component } from 'react'
import Nav from 'react-bootstrap/Nav'
import Error from './Error'

class Mrc extends Component {

    constructor(props) {
        super(props)
        this.state = {
            mrc: ["1"],
            hasError: false
        }
      }

    render(){

        return( 
            <main>
                <Error>
            {this.state.mrc.length == 0 
            ? <div className="text-center" style={{color:"orange", fontSize: "40px"}} ><b>Your MrC is empty!</b></div>
            :
            <Nav style={{paddingLeft:"40px"}} className="flex-column" defaultActiveKey="#laboratory-test-results">
                <Nav.Link eventKey="0" href="#laboratory-test-results">Laboratory test results</Nav.Link>
                <Nav.Link eventKey="1" href="#references">References</Nav.Link>
                <Nav.Link eventKey="2" hreg="#medications-and-prescriptions">Medications and prescriptions</Nav.Link>
                <Nav.Link eventKey="3" hreg="#imaging-test-results">Imaging test results</Nav.Link>
                <Nav.Link eventKey="4" hreg="#your-diagnoses">Your diagnoses</Nav.Link>
                <Nav.Link eventKey="5" hreg="#your-sensitivity">Your sensitivity</Nav.Link>
                <Nav.Link eventKey="6" hreg="#vaccines-you-did">The vaccines you did</Nav.Link>
                <Nav.Link eventKey="7" hreg="#medical-recommendations">Medical recommendations</Nav.Link>
                <Nav.Link eventKey="8" hreg="#certificates-of-illness">Certificates of illness</Nav.Link>
                <Nav.Link eventKey="9" hreg="#medical-information-summary">Medical Information Summary</Nav.Link>
            </Nav>
            }
            <div></div>
            </Error>
            </main>
        );
    }
}
export default Mrc;
